import './Card.css';
import React, { Component } from 'react';

class Card extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div className='card'>
                <h1>{this.props.name}</h1>
                <h2>{this.props.age}</h2>
            </div>
        )
    }

}

export default Card
